class Layout extends Component {
    state = {
        auth:false
    }

    render () {
        return (
            <Aux>

                <Toolbar />
                <main>
                    {this.props.children}
                </main>
                <ButtonTop />
                <Footer />
            </Aux>
        )
    }
};

export default Layout;
